SELECT SUM("probehnuto"."kc_proklikano") as agg_0 FROM "dobito" LEFT OUTER JOIN "client" ON "dobito"."client_id" = "client"."client_id" LEFT OUTER JOIN "probehnuto_mimo_penezenku" ON "client"."client_id" = "probehnuto_mimo_penezenku"."client_id" LEFT OUTER JOIN "probehnuto" ON "client"."client_id" = "probehnuto"."client_id"  WHERE "dobito"."client_id" <= 891135.3882813547 AND "client"."client_id" >= 8997810 AND "probehnuto"."sluzba" IS NOT NULL